import React from 'react';
import { NavLink } from 'react-router-dom';
import './Header.css'

const Header = () => {
  return (
    <nav>
      <ul>
        <li><NavLink to="/portfolio" className="home-link">Home</NavLink></li>
        <li><NavLink to="/cv" className="cv-link">CV</NavLink></li>
        <li><NavLink to="/about" className="about-link">About</NavLink></li>
        <li><NavLink to="/contact" className="contact-link">Contact</NavLink></li>
      </ul>
    </nav>
  );
}

export default Header;
